import React, { useEffect, useState } from 'react';
import Style from './bookings.module.css'
import Loader from  "../../assets/images/loader.jpg";
import { serviceProvider } from '../../api/service';
import BlackArrow from '../../assets/svg/blackArrow.svg'
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import BookingCards from '../../components/bookingCards/BookingCards';

function Bookings() {
   const history = useHistory();
   const [list, setList] = useState([]);
   const [loading, setLoading] = useState(true);
   useEffect(() => {
      serviceProvider().then(responce => {
         const listed=responce.Data.organizations
         setList(listed);
         setLoading(false);
       });
    }, [])
    const handleRoute = (object) =>{
      //  console.log(object.organizationServices);
      //  console.log(object.organizationServices);
      history.push({
         pathname: '/detail',
         state: { apiObject: object }
       })
    }
   return (
      <>
        <div className={Style.home}>
            <div className={Style.topHeading}><img src={BlackArrow} alt="arrow" className={`mr-3`} />Bookings</div>

            <Tabs>
               <TabList>
                  <Tab>Schedule</Tab>
                  <Tab>History</Tab>
               </TabList>
               {loading ? <img src={Loader} alt="loader" className="loader" /> : null}

            {list.map((function(object,i){
               return (
                  <TabPanel>
                  <BookingCards />
                  <BookingCards />
                  <BookingCards />
               </TabPanel>

               )
            }))}
               <TabPanel>
                  <BookingCards />
               </TabPanel>
            </Tabs>
         </div>
      </>
   )
}

export default Bookings
